import React from 'react'
import './App.css'
import {Table} from "./components/table/Table";
import {Card} from "./components/card/Card";

let num = 16;
let arr = [];
for (let i = 1; i <= 16; i++) {
    arr.push(<Card s={"../../../public/" + i + ".jpg"}/>)
}
class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            cards: arr
        }
    }
    render() {
        return <div>
            {this.this.state}
        </div>
    }
}

export default App
